module sky130_fd_sc_hd__dfstp_2(CLK, D, SET_B, Q);
  input CLK, D, SET_B;
  output Q;
  wire CLK, D, SET_B;
  wire Q;
  wire next_state;
  reg  qi;
  assign #1 Q = qi;
  assign next_state = D;
  always 
    @(posedge CLK or negedge SET_B) 
      if (!SET_B) 
        qi <= 1;
